import logo from './4me.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 className="App-header">
        Acronym for me
      </h1>
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
